import React from 'react';
import TodoItem from './TodoItem'

const TodoList = (props) => {
    const del = (title) =>{
        props.todos.filter((item)=>{
            return item.todoTitle !== title
          })
        console.log(props.title,"listdel")
        return props.title
    }
    return (
        <ul className="list-group">
            {
                props.todos.length>0?props.todos.map((item,i)=>{
                    return <TodoItem key={i} title={item.todoTitle} detail={item.todoDetail} del={del}/>
                }):'Nothing In Array'
            }
        </ul>
    );
}

export default TodoList;
